import React from "react";

function Navbar() {
  return (
    <svg
      id="left"
      width="11"
      height="16"
      viewBox="0 0 11 16"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
    >
      <path
        d="M4.2038 5L7.2038 8L4.2038 11"
        stroke="#6F7383"
        stroke-linecap="round"
        stroke-linejoin="round"
      />
    </svg>
  );
}

export default Navbar;
